import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isLoaded: false,
    }
  }

  render() {
    return (
      <div className="App">
        <h1>My Second React Application</h1>
      </div>
    );
  }

} 

export default App;
